import React from 'react'
import Card from 'react-bootstrap/Card'
import engineering from '../assets/images/engineering.png'


function Crd(props){
    return(
        <Card className = "crd-style p-4" style={{border: 'none'}}>
            <Card.Img className = "crd-style-image" variant="top" src={engineering} />
            <Card.Body>
            <Card.Title>{props.title}</Card.Title>
            <p>{props.company}</p>
            <small>{props.time}</small>
            <br/>
            <br/>
            <Card.Text>
                {props.text}
            </Card.Text>
            </Card.Body>
        </Card>
    );
}

export default Crd;
